var myApp=angular.module("myApp",["ngRoute"]);myApp.config(["$routeProvider",function(e){e.when("/users",{templateUrl:"app/views/users-view.html",controller:"ViewUsersController"}).when("/users/:userId",{templateUrl:"user-details.html",controller:"UserProfileController"}).when("/business",{templateUrl:"business-view.html",controller:"ViewBusinessController"}).when("/business/:businessId",{templateUrl:"business-details.html",controller:"BusinessProfileController"}).when("/projects",{templateUrl:"jobs-view.html",controller:"ViewProjectsController"}).when("/projects/:businessId/:projectId",{templateUrl:"business-details.html",controller:"ViewProjectController"}).when("/settings",{templateUrl:"settings-view.html",controller:"ViewSettingsController"}).otherwise({redirectTo:"/users"})}]);